import { useEffect, useState } from 'react';
import { useUser } from '../components/UserContext';
import { useNavigate } from 'react-router-dom';
import Header from '../components/Header';
import axios from 'axios';
import styled from 'styled-components';
import GlobalStyles from '../styles/GlobalStyles';

const PagesDiv = styled.div`
    min-height: 80vh;
    margin-top: 5px;
    height: auto;
    width: auto;
    align-self: center;
    align-items: center;
`;

const FormTipoUsuario = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`;

function Tipos() {
    document.title = "Tipos | AMM";

    const [tiposDocumento, setTiposDocumento] = useState([]);
    const [tiposLimpieza, setTiposLimpieza] = useState([]);
    const [tiposUsuario, setTiposUsuario] = useState([]);

    const [nuevoDoc, setNuevoDoc] = useState({ id_tipoDocu: '', nombre_tipo: ''});
    const [nuevaLimp, setNuevaLimp] = useState({id_tipoLimp: '', nombre_tipo: ''});

    // cargar datos
    useEffect(() => {
        cargarDatos();
    }, []);

    const cargarDatos = async () => {
        try {
            const [resDoc, resLimp, resUsua] = await Promise.all([
                axios.get('http://localhost:3001/tipos/documento')
            ]);
        } catch (error) {
            console.error(error);
        }
    };

    return(<>
        <GlobalStyles/>
        <Header/>
        <PagesDiv>
            <div>
                
            </div>
        </PagesDiv>
    </>);
}

export default Tipos;
